<content id="CTA673" typecode="CTA" typedescr="Contenuto lista"><descr>Contenuto F.A.Q.</descr><groups mainGroup="free" /><categories /><attributes><attribute name="title" attributetype="Text"><text lang="en">F.A.Q.</text></attribute><list name="lista" attributetype="Monolist" nestedtype="Composite"><composite name="lista" attributetype="Composite"><attribute name="title" attributetype="Text"><text lang="en">Domanda: Che cosa  il circondario?</text></attribute><attribute name="abstract" attributetype="Longtext"><text lang="en">Risposta: Il circondario  la porzione di territorio dove si estende la competenza del Tribunale e, di conseguenza, della Procura della Repubblica presso il Tribunale. Spesso coincide con la provincia, come nel nostro caso</text></attribute><attribute name="img" attributetype="Image" /><attribute name="link" attributetype="Link" /><attribute name="date" attributetype="Date"><date>20181207</date></attribute><attribute name="number" attributetype="Number"><number>1</number></attribute></composite><composite name="lista" attributetype="Composite"><attribute name="title" attributetype="Text"><text lang="en">Domanda: Che cosa  il distretto?</text></attribute><attribute name="abstract" attributetype="Longtext"><text lang="en">Risposta: Il distretto  la porzione di territorio dove si estende la competenza della Corte d''Appello e di tutti i Tribunali che in esso insistono. Di conseguenza, si ricava la competenza della Procura Generale e delle Procure della Repubblica da essa dipendenti. Corrisponde spesso alla regione, come nel nostro caso.</text></attribute><attribute name="img" attributetype="Image" /><attribute name="link" attributetype="Link" /><attribute name="date" attributetype="Date"><date>20181202</date></attribute><attribute name="number" attributetype="Number"><number>2</number></attribute></composite><composite name="lista" attributetype="Composite"><attribute name="title" attributetype="Text"><text lang="en">Domanda: Che differenza c''  tra Procura, Pretura e Prefettura?</text></attribute><attribute name="abstract" attributetype="Longtext"><text lang="en">Risposta: Anche se il suono di queste parole pu trarre in inganno, sono tre uffici molto diversi tra loro. Anzitutto la Pretura non esiste pi dal 1999: era un ufficio simile, per competenze, al Tribunale. La Prefettura  l''Ufficio Territoriale del Governo dove ha sede il Prefetto (Ministero dell''Interno). La Procura  l''ufficio giudiziario dove ha sede il Procuratore della Repubblica (Ministero della Giustizia).</text></attribute><attribute name="img" attributetype="Image" /><attribute name="link" attributetype="Link" /><attribute name="date" attributetype="Date"><date>20181207</date></attribute><attribute name="number" attributetype="Number"><number>3</number></attribute></composite><composite name="lista" attributetype="Composite"><attribute name="title" attributetype="Text"><text lang="en">Domanda: La Procura di Ravenna ha uffici distaccati a Lugo e a Faenza, come il Tribunale?</text></attribute><attribute name="abstract" attributetype="Longtext"><text lang="en">Risposta: No, la Procura di Ravenna ha una sola sede, quella di via Falcone 67 a Ravenna. Presso le sezioni del Tribunale di Faenza e Lugo vi  un ufficio del PM al quale si accede solo su sua convocazione.</text></attribute><attribute name="img" attributetype="Image" /><attribute name="link" attributetype="Link" /><attribute name="date" attributetype="Date"><date>20181207</date></attribute><attribute name="number" attributetype="Number"><number>4</number></attribute></composite></list></attributes><status></status><version>6.1</version><firstEditor>admin</firstEditor><lastEditor>admin</lastEditor><created>20181218102336</created><lastModified>20190404164444</lastModified></content>
','20181218102336','20190404164444','<?xml version="1.0" encoding="UTF-8"?>
